import React from "react";
// import {Link , NavLink} form 'react-router-dom'
function Menu (){
    return (
        <nav className="bg-dark text-white d-flex justify-content-between" style={{"padding":"10px,10px"}}>
            <div >
                <NavLink to="">Logo</NavLink  >
            </div >
            <div >
                <ul className="d-flex" style={{"listStyleType":"none"}}>
                    <li ><NavLink to="/Docs" style={{"textDecoration": "none", "marginRight":"8px" , "color":"white"}}>Docs</NavLink></li >
                    <li ><NavLink to="/Community" style={{"textDecoration": "none", "marginRight":"8px" , "color":"white"}}>Community</NavLink></li >
                    <li ><NavLink to="/Tutoriel" style={{"textDecoration": "none", "marginRight":"8px" , "color":"white"}}>Tutorial</NavLink></li >
                </ul>
            </div >
        </nav>
    )
}
export default Menu
